    "2016-07-27T22:42:58.468962",nt"name": "arrowwood-national-wildlife-refuge-narrative-report-september-october-november-decemb-1948",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Arrowwood NWR
    outlines Refuge accomplishments from September through December of 1948. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. Resource
    management is outlined; topics include grazing, haying, and fur harvesting. The
    public relations section of the report describes recreational uses and Refuge visitors.
    N-R forms and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
